import { Link } from "react-router-dom";
import "./navi.css"

export default function Navi() {

 const naviList=[
  ["Hakkımızda", "/about"],
  ["Hizmetler","/services"],
  ["İletişim","/contact"],
  ["Fiyatlar","/prices"],
].map(([list,url])=>
    <li >
      <Link className="list-Link" to={url}> {list}</Link>
    </li>
);

  return (
    <nav className="main-nav">
      <div className="line"></div>
     <div>
        <h1 className="logo">
          HTC Güzellik <br/> Salonu
        </h1>
 </div>
      <ul className="list">{naviList}</ul>
    <div className="aa">

    </div>
    </nav>
  );
}
